// frontend/src/components/Pages/LoginPage.js
import React from 'react';

function LoginPage() {
  return (
    <div>
      <h2>Login</h2>
      <p>Formulário de login aparecerá aqui.</p>
    </div>
  );
}

export default LoginPage;
